void FreeToken(Token* tok) {
    if (tok->strval != NULL) {
        ckfree(tok->strval);
    }
    if (tok->vars != NULL) {
        Token* tmp, *next;
        for (tmp=tok->vars; tmp; ) {
            next = tmp->next;
            FreeToken(tmp);
            tmp = next;
        }
    }
    ckfree((char *) tok);
}

